import React, { useState } from 'react';
import './YourProfile.css';

const YourProfile = () => {
  const [profile, setProfile] = useState({
    firstName: 'Shreya',
    lastName: 'Sharma',
    dob: '1998-05-20',
    mobile: '9876543210',
    email: 'shreya@example.com',
  });

  const [isEditing, setIsEditing] = useState(false);
  const [message, setMessage] = useState('');

  const handleChange = (e) => {
    setProfile({
      ...profile,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setIsEditing(false); // Close the form
    setMessage('Changes saved successfully!');
  };

  const handleEditClick = () => {
    setIsEditing(true); // Show the form
    setMessage(''); // Clear any previous messages
  };

  const handleCloseClick = () => {
    setIsEditing(false); // Hide the form
  };

  return (
    <div className="profile-container">
      <h2>Your Profile</h2>

      <div className="profile-details">
        <div className="profile-item">
          <strong>First Name:</strong> <span>{profile.firstName}</span>
        </div>

        <div className="profile-item">
          <strong>Last Name:</strong> <span>{profile.lastName}</span>
        </div>

        <div className="profile-item">
          <strong>Date of Birth:</strong> <span>{profile.dob}</span>
        </div>

        <div className="profile-item">
          <strong>Mobile Number:</strong> <span>{profile.mobile}</span>
        </div>

        <div className="profile-item">
          <strong>Email Address:</strong> <span>{profile.email}</span>
        </div>
      </div>

      <button onClick={handleEditClick} className="edit-btn">
        Click here to edit
      </button>

      {isEditing && (
        <div className="edit-form">
          <form onSubmit={handleSubmit}>
            <div className="input-group">
              <label htmlFor="firstName">First Name</label>
              <input
                type="text"
                id="firstName"
                name="firstName"
                value={profile.firstName}
                onChange={handleChange}
                required
              />
            </div>

            <div className="input-group">
              <label htmlFor="lastName">Last Name</label>
              <input
                type="text"
                id="lastName"
                name="lastName"
                value={profile.lastName}
                onChange={handleChange}
                required
              />
            </div>

            <div className="input-group">
              <label htmlFor="dob">Date of Birth</label>
              <input
                type="date"
                id="dob"
                name="dob"
                value={profile.dob}
                onChange={handleChange}
                required
              />
            </div>

            <div className="input-group">
              <label htmlFor="mobile">Mobile Number</label>
              <input
                type="tel"
                id="mobile"
                name="mobile"
                value={profile.mobile}
                onChange={handleChange}
                required
              />
            </div>

            <div className="input-group">
              <label htmlFor="email">Email Address</label>
              <input
                type="email"
                id="email"
                name="email"
                value={profile.email}
                onChange={handleChange}
                required
              />
            </div>

            <button type="submit" className="save-btn">
              Save Changes
            </button>
            <button type="button" className="close-btn" onClick={handleCloseClick}>
              Close
            </button>
          </form>
        </div>
      )}

      {message && <p className="success-message">{message}</p>}
    </div>
  );
};

export default YourProfile;
